Let $x = \angle BAC,$ so $\angle BDC = 3x.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(D--A--B--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
label("$x$", (A + B)/2, NW);
label("$3x$", (B + D)/2, NW);
label("$3x$", (D + C)/2, NE);
label("$x$", (A + C)/2, SE);
[/asy]

Since $\angle BAC = x,$ $\angle B = \angle C = \frac{180^\circ - x}{2} = 90^\circ - \frac{x}{2}.$

Since $\angle BDC = 3x,$ $\angle BDA = \angle CDA = 180^\circ - 3x.$

Since $\angle BDA + \angle B = 180^\circ,$ $\angle ADB = 90^\circ - \frac{x}{2} = \angle B.$

Since $\angle CDA + \angle C = 180^\circ,$ $\angle ADC = 90^\circ - \frac{x}{2} = \angle C.$

Therefore, $\triangle ADB \sim \triangle ABC \sim \triangle ADC.$

Since $\triangle ADB \sim \triangle ABC,$ $\frac{AB}{AD} = \frac{AB}{10} = \frac{AC}{AB}.$

Since $\triangle ADC \sim \triangle ABC,$ $\frac{AC}{AD} = \frac{AC}{10} = \frac{AB}{AC}.$

Therefore, $AB^2 = 10 \cdot AC$ and $AC^2 = 10 \cdot AB.$

Therefore, $AB^4 = 100 \cdot AB \cdot AC = 100 \cdot 10 \cdot AB = 1000 \cdot AB.$

Therefore, $AB = \sqrt[3]{1000} = 10.$

Therefore, $AC = \sqrt{10 \cdot AB} = \sqrt{1000} = 10\sqrt{10}.$

Therefore, the perimeter of $\triangle ABC$ is $AB + AC + BC = 10 + 10\sqrt{10} + 2 \cdot 10 = \boxed{10 + 10\sqrt{10} + 20} = \boxed{30 + 10\sqrt{10}}.$

Поради кандидати, каде на даден брой моли и една гума чинате даден брой дolarов. Т.е. $3m+g=124$ и $9m+g=182$. $9m+g-(3m+g)=182-124$, $6m=58$, $m=\frac{58}{6}=\frac{29}{3}$. $3m+g=124$, $3\cdot\frac{29}{3}+g=124$, $29+g=124$, $g=95$. $100m=100\cdot\frac{29}{3}=\frac{2900}{3}=966\frac{2}{3}$. Една молiva чини $966\frac{2}{3}$ дolarов.  \[
\boxed{966\frac{2}{3}}
